import logo from "../../logofooter.png";
import footer from "../../footer.png";
import { BsTelephoneOutbound } from "react-icons/bs";
import { AiOutlineMail } from "react-icons/ai";
import { FiTwitter } from "react-icons/fi";
import "./nav.css";
import { height } from "@mui/system";
function Footer() {
	return (
		<div
			className='headhead'
			style={{
				backgroundImage: `url(${footer})`,
				height: "447px",
				backgrounPosition: "center",
				backgroundPosition: "0px -160px",
			}}
		>
			<div>
				<img src={logo} className='logo text-white' alt='logo' />
				<h1 className='text-white fs-6 fw-light mt-3'>
					10 New Town Street, V2 5NW,
				</h1>
				<h1 className='text-white fs-6 fw-light'>Newstate, USA.</h1>
				<p className='p2 mt-4 d-flex text-white  align-items-center'>
					<BsTelephoneOutbound
						style={{
							marginRight: 5,
							width: 20,
							height: 20,
							color: "white",
						}}
					/>
					+88 01924 184 461
				</p>
				<p className='p2 mt-4 d-flex text-white  align-items-center'>
					<AiOutlineMail
						style={{
							marginRight: 5,
							width: 20,
							height: 20,
							color: "white",
						}}
					/>
					shovasatkhira@gmail.com
				</p>
				<div className='d-flex'>
					<div
						className=' border rounded-circle border-white d-flex justify-content-center align-items-center'
						style={{ width: 35, height: 35 }}
					>
						<FiTwitter
							className='mx-5'
							style={{
								marginRight: 5,
								width: 20,
								height: 20,
								color: "white",
							}}
						/>
					</div>
					<div
						className=' border rounded-circle border-white d-flex justify-content-center align-items-center'
						style={{ width: 35, height: 35 }}
					>
						<FiTwitter
							className='mx-5'
							style={{
								marginRight: 5,
								width: 20,
								height: 20,
								color: "white",
							}}
						/>
					</div>
					<div
						className=' border rounded-circle border-white d-flex justify-content-center align-items-center'
						style={{ width: 35, height: 35 }}
					>
						<FiTwitter
							className='mx-5'
							style={{
								marginRight: 5,
								width: 20,
								height: 20,
								color: "white",
							}}
						/>
					</div>
					<div
						className=' border rounded-circle border-white d-flex justify-content-center align-items-center'
						style={{ width: 35, height: 35 }}
					>
						<FiTwitter
							className='mx-5'
							style={{
								marginRight: 5,
								width: 20,
								height: 20,
								color: "white",
							}}
						/>
					</div>
				</div>
			</div>
		</div>
	);
}

export default Footer;
